import { Link } from "react-router-dom";

export default function Navbar(){
  return (
    <nav className="sticky top-0 z-50 bg-[#0d0d0d] px-10 py-4 flex justify-between">
      <h2 className="text-2xl font-bold">BOLD<span className="text-[#EC7B2F]">.</span></h2>
      <div className="space-x-4">
        <Link to="/" className="px-4 py-2 rounded hover:bg-[#EC7B2F]">Home</Link>
        <Link to="/services" className="px-4 py-2 rounded hover:bg-[#EC7B2F]">Services</Link>
        <Link to="/portfolio" className="px-4 py-2 rounded hover:bg-[#EC7B2F]">Portfolio</Link>
        <Link to="/about" className="px-4 py-2 rounded hover:bg-[#EC7B2F]">About</Link>
        <Link to="/contact" className="px-4 py-2 rounded hover:bg-[#EC7B2F]">Contact</Link>
      </div>
    </nav>
  );
}
